command.post_template:
{assign_object_variable var="Network_interfaces" value="{$params.object_id} - {$params.subnetId} - {$params.availability_zone} - {$params.status}"}

{if  $params.status == 'available' }
      {assign_object_variable var="_color" value=green}
{/if}
{if  $params.status == 'in-use' }
      {assign_object_variable var="_color" value=red}
{/if}
